    super(props)
    this.state = {
      idBooking: '',
      idChair: '',
      idCar: '',
      dayGo: '',
      timeGo: ''
    }
  }
  render() {
    return (
      <div className='container'>
        <form action='/bookingTickets' method='POST'>
          <label for="my-input">Số xe</label>
          <input id="my-input" className="form-control" type="text" name="idxe" />
          <label for="my-input">Số ghế</label>
          <input id="my-input" className="form-control" type="text" name="idghe" />
          <label for="my-input">Ngày đi</label>
          <input id="my-input" className="form-control" type="text" name="ngaydi" />
          <label for="my-input">Giờ đi</label>
          <input id="my-input" className="form-control" type="text" name="giodi"></input>
        </form>
      </div>
    )
  }
}

export default BookingTickets
